Director: Michael Raven
Studio: Sin City

An erotic version of a legendary sex god and his mortal lover. Jessica is haunted by a dark sexual fantasy of a winged man who ravishes her very soul. Night after night she dreams of orgasmic sexual encounters with the mythically delicious women and the most decadent of men.. Will this perverted punishment ever end? Finally she realizes her true identity, she is the sex goddess Psyche reborn and her dream lover is the infamous god Cupid returned to claim her as his own for all eternity.
